I think that'd work.

If I'm understanding correctly:
1. Webpage has a button on it that user clicks, which sends a request to some API
2. API upon receiving the request contacts Authelia to get ID Token and sends that back down to webpage
3. Webpage sets it as a cookie
4. Additional requests made via this browser have the ID Token cookie attached.
5. Nginx will need to set something like (Essentially pass the Token from however it arrives to nginx to a header that's sent on `auth_request`):
```
set $id_token "";
if ($http_cookie ~* "id_token=([^;]+)(?:;|$)") {
    set $id_token $1;
}

location /whatever/ {
  auth_request_set $remote_user $upstream_http_remote_user;
  auth_request_set $id_token $upstream_http_authorization;
  ... Rest of stuff
}

location /authelia-auth {
  internal;
  proxy_set_header Authorization "Bearer $id_token";
  ... Rest of stuff
}
```
So that the cookie is passed to Authelia when auth_request happens. Maybe a way to tell Authelia what groups the ID Token should have (must be a subset of the groups the user is in) when the token is being created?
